import styled from "styled-components";

export const Wrapper = styled.div`
  background: var(--darkGrey);
  border-radius: 20px;
  color: var(--white);
  text-align: center;
`;

export const Image = styled.img`
  border-radius: 20px;
  display: flex;
  max-width: 720px;
  width: 100%;
`;
